import React from 'react';
import { Link } from 'react-router-dom/cjs/react-router-dom';


export default function Cadastrar() {
    return(
        <div className="cadastrar-container">
           <toolbar id="margem">
                <button id="voltar" onClick="/"></button>
                <h1>Cadastrar</h1>
                <Link>Confirmar</Link>
            </toolbar>
            <form>
                <input type="text"/>
                <input type="password" />
            </form>

            </div>

    );
}
